const OtherSkills = () => {
  return (
    <section>
        <div className='flex flex-col'>
        <div class="w-full bg-gray-200 rounded-full dark:bg-gray-700">
            <div id="problem-Solving" class="bg-blue-600 text-sm font-medium text-blue-100 text-center p-0.5 leading-none rounded-full"> 45%</div>
        </div>

        </div>
    </section>
  )
}

export default OtherSkills
